            <form class="w-full max-w-sm" method="POST" action="{{ route('login') }}">
              @csrf
              <div class="mb-6">
                <label for="email" class="block text-gray-700 font-bold mb-2">Email address</label>
                <input type="email" class="w-full px-3 py-2 text-gray-700 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400" id="email" name="email" aria-describedby="emailHelp" placeholder="Enter email">
                <small id="emailHelp" class="block mt-1 text-xs text-gray-600">We'll never share your email with anyone else.</small>
              </div>
              <div class="mb-6">
                <label for="password" class="block text-gray-700 font-bold mb-2">Password</label>
                <input type="password" class="w-full px-3 py-2 text-gray-700 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400" id="password" name="password" placeholder="Password">
              </div>
              <div class="flex items-center mb-6">
                <input type="checkbox" class="form-checkbox h-5 w-5 text-blue-600 transition duration-150 ease-in-out" id="remember" name="remember">
                <label class="ml-2 block text-gray-700">Remember me</label>
              </div>
              <button type="submit" class="w-full px-4 py-2 font-bold text-white bg-blue-500 rounded-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-400 focus:ring-opacity-50">
                Submit
              </button>
